pragma solidity >=0.4.21;
pragma experimental ABIEncoderV2;


contract MarketPlace {

    struct Property {
        uint price;
        string propertyAddress;
        string urlImage;
        string description;
        uint surface;
        string hashDocument;
    }

    Property[] properties;

    mapping (uint => address) public propertiesToOwner;
    mapping (address => uint) public ownerPropertiesCount;

    event NewProperty(uint id);
    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    function createProperty(uint _price, string memory _propertyAddress,
        string memory _urlImage, string memory _description, uint _surface, string memory _hashDocument) public {

        // Add the properties.
        Property memory newProperty = Property(
            _price,
            _propertyAddress,
            _urlImage,
            _description,
            _surface,
            _hashDocument
        );

        uint256 id = properties.push(newProperty) - 1;

        // Add the owner of the property.
        propertiesToOwner[id] = msg.sender;
        ownerPropertiesCount[msg.sender]++;
        emit NewProperty(id);
    }


    // function _buyProperty(uint _id, address _buyer) public payable {
    //     propertiesToOwner[_id] = _buyer;
    // }

    function transfer(address _to, uint256 _tokenId) public payable {
        _transfer(msg.sender, _to, _tokenId);
    }

    function _transfer(address _from, address _to, uint _tokenId) private {
        ownerPropertiesCount[_to]++;
        ownerPropertiesCount[_from]--;
        propertiesToOwner[_tokenId] = _to;
        emit Transfer(_from, _to, _tokenId);
    }

    function getOwnerPropertiesCount(address _address) public view returns (uint){
        return  ownerPropertiesCount[_address];
    }

    function getPropertiesCount() public view returns(uint count) {
        return properties.length;
    }

    function getAllProperties() public view returns(Property[] memory){
        return properties;
    }
}
